		Write-Host "Inactive Domain Admins Honey Tokens" -ForegroundColor Gray -BackgroundColor Black
		Get-InactiveDomainAdmins (Get-DomainAdmins) | ft -AUTO	
	}
		
## Execute DLL Loader
	if(!$OpSec)
	{
		$Loader64Block = {
		if((([System.Environment]::OSVersion.Version).Build) -eq 15063)
		{
			Write-Host "WARNING - Windows 10 Creators Update Partial Support" -ForegroundColor Yellow -BackgroundColor Black
